import {  GET_PLACE ,
  GOT_PLACE, 
  FAIL_PLACE,  }  from '../Actions/lodgeA';

const initialState = {
 name:[],
 loading:false,
 err:''
//  message:'' 
};

export const lodge = (state = initialState, action) => {
  switch (action.type) {
    case GET_PLACE:
      return {
        ...state,
        loading:true,
        name:[]
      }
      case GOT_PLACE:
        return {
          ...state,
          name:[],
          err:action.paylaod,
          // message:'error did not receive data'
        }
    case FAIL_PLACE:
      return {
        ...state,
        name:action.paylaod,
        loading:false,
        // message:'grabbing'
      }
    default: 
    return state;
  } 
}
